import React from "react";
import { TextField, Typography, Box, makeStyles, Grid } from "@material-ui/core";
const useStyle = makeStyles({
    header: {
        color: 'white',
        background: "blue"
    }
})
const AddStudent = () => {
    const classes = useStyle();
    return (
        <>
            <Grid item md={6}>
                <Box>
                    <Typography variant='h5' align='center' className={classes.header} >Add Student </Typography>
                </Box>
                <Box pt={4}>
                    <TextField variant='outlined' fullWidth label='firstname' placeholder='Enter Your first Name' ></TextField>
                </Box>
            </Grid>
        </>
    );
};

export default AddStudent;
